impl Solution {
    pub fn beautiful_indices(s: String, a: String, b: String, k: i32) -> Vec<i32> {
        let mut beautiful_indices = Vec::new();
        let s_bytes = s.as_bytes();
        let a_bytes = a.as_bytes();
        let b_bytes = b.as_bytes();
        let mut a_positions = Vec::new();
        let mut b_positions = Vec::new();

        for i in 0..=s.len() - a.len() {
            if &s_bytes[i..i + a.len()] == a_bytes {
                a_positions.push(i as i32);
            }
        }

        for i in 0..=s.len() - b.len() {
            if &s_bytes[i..i + b.len()] == b_bytes {
                b_positions.push(i as i32);
            }
        }

        for &a_pos in &a_positions {
            for &b_pos in &b_positions {
                if (b_pos - a_pos).abs() <= k {
                    beautiful_indices.push(a_pos);
                    break;
                }
            }
        }

        beautiful_indices.sort_unstable();
        beautiful_indices
    }
}
